INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('465', 'NL', 'Is er wat nieuws over het cachen?<br />\r\nMeldt het nieuwsbericht dan hier en het zal op de startpagina verschijnen.', '2011-02-04 19:50:07');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('466', 'NL', 'De activatie van jouw account is gelukt. Je kunt nu inloggen op de inlogpagina.<br /><br /> <a href=\"login.php\">Naar inlog paginalt;/a>', '2011-02-04 19:50:07');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('467', 'NL', 'Hint', '2011-02-04 19:50:07');
