INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('470', 'NL', 'Wij vragen om wat geduld, wij doen ons best om de site zo snel mogelijk weer online te hebben.', '2011-02-04 19:50:07');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('471', 'NL', 'Het account kon niet gemaakt worden, de reden is onbekend. Indien je het probleem niet zelf op kunt lossen, neem dan contact op via <a href=\"mailto:%1\">E-Mail</a>.', '2011-02-04 19:50:07');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('472', 'NL', 'Wij respecteren jouw privacy. Jouw persoonlijke gegevens worden opgeslagen in onze database en niet doorgegeven aan derden. Let op onze gedetailleerde <a href=\"articles.php?page=dsb\">Privacy verklaring</a>.Mochten er nog vragen zijn, kun je contact met ons opnemen via <a href=\"mailto:%1\">contact us</a> <b>voordat</b> je een account aanmaakt.', '2011-02-04 19:50:07');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('473', 'NL', 'Wij moeten jouw nieuwsbericht eerst keuren alvorens wij het plaatsen. Wij proberen dit binnen 24 tot 48 uren te doen.\r\nHet nieuwsbericht kun je niet meer veranderen nadat het geplaatst is. Mocht het noodzakelijk zijn om iets gewijzigd te hebben\r\nkun je het gecorrigeerde bericht nogmaals verzenden.Je mag elk soort nieuws plaatsen als het maar met cachen te maken heeft,\r\nmaar het is niet toegestaan advertenties te plaatsen over pruducten en/of caches. Het is aan de keuringscommissie te bepalen welke\r\nnieuwsberichten er geplaatst worden. In geval van twijfel kan het nieuwsbericht verzonden worden en en te wachten tot het gepubliceerd\r\nword of je kunt een mail sturen naar <a href=\"mailto:%1\">%1</a> voordat je het nieuwsbericht gaat plaatsen.', '2011-02-04 19:50:07');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('474', 'NL', 'Mocht het probleem langer aanhouden, neem dan contact met ons op via <a href=\"mailto:%1\">%1</a>.', '2011-02-04 19:50:07');
