INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1587', 'NL', 'Zaklamp', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1588', 'NL', 'Klimuitrusting', '2011-02-04 19:50:08');
